import styles from '../styles/scss/profile.module.scss';
import { useEffect } from 'react';

const Profile = () => {
	useEffect(
		() => {
			effect;
			return () => {
				cleanup;
			};
		},
		[ input ]
	);

	return (
		<div className={styles.profileContainer}>
			<img className={styles.profileImage} src="/images/profile.jpg" />
			<h3 />
		</div>
	);
};

export default Profile;
